import 'package:flutter/material.dart';

class Listviewbuilder extends StatefulWidget {
  const Listviewbuilder({super.key});

  @override
  State<Listviewbuilder> createState() => _ListviewbuilderState();
}

class _ListviewbuilderState extends State<Listviewbuilder> {
  List imageURL = [
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "https://media.istockphoto.com/id/1252455620/photo/golden-retriever-dog.jpg?s=612x612&w=0&k=20&c=3KhqrRiCyZo-RWUeWihuJ5n-qRH1MfvEboFpf5PvKFg=",
    "https://images.wagwalkingweb.com/media/daily_wag/blog_articles/hero/1723114015.705158/popular-dogs-hero-1.jpg",
  ];
  @override
  Widget build(BuildContext context) {
    return Scaffold(
      body: Center(
        child: ListView.builder(
          itemCount: imageURL.length,
          itemBuilder: (context, index) {
            return Container(
              height: 400,
              width: 200,
              decoration: BoxDecoration(
                color: Colors.red,
                border: Border.all(color: Colors.black),
              ),
              child: Image.network(imageURL[index], fit: BoxFit.contain),
            );
          },
        ),
      ),
    );
  }
}
